(window.webpackJsonp=window.webpackJsonp||[]).push([[205],{121:function(t){t.exports=JSON.parse('{"title":"javascript 原型模式","sidebar_label":"原型模式","id":"patterns/prototype","description":"原型模式是创建型模式的一种，其特点在于通过「复制」一个已经存在的实例来返回新的实例,而不是新建实例。被复制的实例就是我们所称的「原型」，这个原型是可定制的。原型模式多用于创建复杂的或者耗时的实例，因为这种情况下，复制一个已经存在的实例使程序运行更高效；或者创建值相等，只是命名不一样的同类数据。","source":"@site/docs/patterns/prototype.md","permalink":"/docs/patterns/prototype","sidebar":"patterns","category":"创建型模式(4)","next":"patterns/adapter","previous":"patterns/builder","previous_title":"javascript 建造者模式","next_title":"javascript 适配器模式"}')}}]);